import React from 'react';
import PropertyListings from '../components/PropertyListings';

const Properties = () => {
  return (
    <div className="page-container">
      <div className="container">
        <h1 className="section-title">Properties</h1>
        <PropertyListings />
      </div>
    </div>
  );
};

export default Properties;
